import React from "react";

const Main = () => {
    return (
        <main className="main">
            
            <h1>Sveiki atvykę į mano pasaulį!</h1>



            <p>Esu grafinės dizainerė ir iliustratorė.</p>
            <h2>Mano darbai</h2>
            <div className="work-list">
                <div className="work-item">
                    <span>Grafinio dizaino darbai</span>
                    <button>Detalės</button>
                </div>
                <div className="work-item">
                    <span>Makėtai</span>
                    <button>Detalės</button>
                </div>
            </div>
            <div className="illustration">
                <p>Mano pasaulis.</p>
                <img src="/nuotraukos/1_as.png" alt="Paveikslėlis" />
            </div>
        </main>
    );
};

export default Main;
